import React from 'react';
import axios from 'axios';
import { withRouter } from "react-router-dom";

class Employee extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
          error: null,
          isLoaded: false,
          employees: []
        };
      }

      componentDidMount() {
        axios.get('http://dummy.restapiexample.com/api/v1/employees')
            .then(function (response) {
                if(response.status === 'success'){
                    this.setState({
                        isLoaded: true,
                        employees: response.data
                    })
                }
            })
            .catch(function (error) {
                console.log(error);
            });
      }    

  render() {
    return <div class="container">
                <table class="table">
                <thead>
                    <tr>
                    <th scope="col">#</th>
                    <th scope="col">Employee Name</th>
                    <th scope="col">Salary</th>
                    <th scope="col">Age</th>
                    </tr>
                </thead>
                <tbody>
                    <tr>
                    <th scope="row">1</th>
                    <td>Mark</td>
                    <td>Otto</td>
                    <td>@mdo</td>
                    </tr>
                    <tr>
                    <th scope="row">2</th>
                    <td>Jacob</td>
                    <td>Thornton</td>
                    <td>@fat</td>
                    </tr>
                    <tr>
                    <th scope="row">3</th>
                    <td>Larry</td>
                    <td>the Bird</td>
                    <td>@twitter</td>
                    </tr>
                </tbody>
                </table>
         </div>;
  }
}

export default withRouter(Employee);
